import {
  Navbar,
  Nav,
  NavDropdown,
  Form,
  FormControl,
  Button,
} from "react-bootstrap";
import ConvoDetail from './Convos'
import React from "react";
function NaviBar(props) {

    return (
      <Navbar bg="dark" expand="lg" className="remeshBlue" >
        <Navbar.Brand href="#home" className="remeshLogo">React-Bootstrap</Navbar.Brand>
          <Form inline>
            <FormControl type="text" placeholder="Search" className="mr-sm-2" value={props.search} onChange={props.updateSearch} name="searchbox" />
            <Button variant="outline-success">Search</Button>
          </Form>
      </Navbar>
    );
  }

export default NaviBar
